.contact {

    .info-section {
        padding: 54px;
        width: 35%;
    }

    .content-area {
        margin-left: 35%;
        width: 65%;
        background: $color3;
        height: 100%;
        // padding: 0 0 0 25%;

        .img-container {
            display: inline-block;
            width: 30%;
            position: relative;
            height: 100%;

            .form-section {
                position: absolute;
                top: 56px;
                left: -250px;
                width: 500px;
                height: calc(100% - 112px);
                background: $color2;
                color: $color3;
                padding: 46px;
                -webkit-box-shadow: 10px 20px 80px 20px rgba(0,0,0,0.35);
                -moz-box-shadow: 10px 20px 80px 20px rgba(0,0,0,0.35);
                box-shadow: 10px 20px 80px 20px rgba(0,0,0,0.35);
                overflow-y: auto;
                overflow-x: hidden;

                h4 {
                    font-size: 1.3rem;
                    margin-bottom: 2rem;
                    margin-top: 4rem;
                }
                
                input[type="text"], input[type="email"], textarea {
                    width: 100%;
                    background: transparent;
                    border: none;
                    border-bottom: 2px solid $color5;
                    margin-bottom: 2rem;
                    font-size: .8rem;
                    line-height: 1.2;
                    color: $color5;
                    padding: 15px 0;
                    font-family: sans-serif;
                }
                
                button[type="submit"] {
                    background: $color1;
                    border: none;
                    -webkit-border-radius: 30px;
                    -moz-border-radius: 30px;
                    border-radius: 30px;
                    text-align: center;
                    color: $color3;
                    font-size: 1rem;
                    padding: 17px 30px;
                    text-transform: uppercase;
                    width: 100%;
                }
            }
        }

        .contact-section {
            vertical-align: top;
            // display: inline-block;
            padding: 56px;
            width: 70%;
            float: left;
            // background: #fefefe;

            .contact-info {

                h1 {
                    font-size: 2.3rem;
                    font-weight: 500;
                    line-height: 1.2;
                    margin: 0 0 1rem;

                    span {
                        color: $color1;
                    }
                }

                .contact-box {
                    max-width: 600px;
                    width: 100%;
                    padding: 30px;
                    transition: all .3s ease-in-out;
                    cursor: pointer;
                    
                    &:hover{
                        -webkit-box-shadow: 0px 20px 74px 20px rgba(0,0,0,0.12);
                        -moz-box-shadow: 0px 20px 74px 20px rgba(0,0,0,0.12);
                        box-shadow: 0px 20px 74px 20px rgba(0,0,0,0.12);
                    }

                    h5 {
                        font-weight: 600;
                        font-size: 1.1rem;
                        margin: 0 0 1.5rem;
                    }

                    p {
                        color: $color5;
                        font-weight: 300;
                        line-height: 1.4;
                        margin: 0 0 2rem;
                    }
                }
            }
        }
    }
}


